import Layout from "../Layout";

export default function FAQ() {
  return (
    <Layout>
      <div class="card">
        <div class="card__content">
          <div class="card__date"> 01 . 05 . 2022</div>
          <div class="card__info">
            <h3>NOTE</h3>
          </div>
        </div>
      </div>
    </Layout>
  );
}
